import Navbar from 'react-bootstrap/Navbar';
import Header from 'partials/head';

const Index = () => (
  <div>
    <Header />
  <Navbar bg="dark" variant="dark" className="nbar">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />{' '}
      React Bootstrap
    </Navbar.Brand>
  </Navbar>
    <p>Hello Next.js</p>
  </div>
);

export default Index;
